import React from 'react';
import deidara from '../images/deidara.jpeg';
import hidan from '../images/hidan.jpeg';
import itachi from '../images/itachi.jpeg';
import kisame from '../images/kisame.webp';
import konan from '../images/konan.jpeg';
import orochimaru from '../images/orochimaru.jpeg';
import pain from '../images/pain.jpeg';
import sasori from '../images/sasori.jpeg';
import tobi from '../images/tobi.jpg';
import zetsu from '../images/zetsu.jpeg';


const Data = 
    [
        {
            img : deidara,
            title: "Deidara"
        },
        {
            img : hidan,
            title: "Hidan"
        },
        {
            img : itachi,
            title: "Itachi"
        },
        {
            img : kisame,
            title: "Kisame"
        },
        {
            img : konan,
            title: "Konan"
        },
        {
            img : orochimaru,
            title: "Orochimaru"
        },
        {
            img : pain,
            title: "Pain"
        },
        {
            img : sasori,
            title: "Sasori"
        },
        {
            img : tobi,
            title: "Tobi"
        },
        {
            img : zetsu,
            title: "Zetsu"
        } 
    ];

export default Data;
